        Sutton Hoo ship burial\u003C\/strong\u003E\u003C\/span\u003E\u003Cbr \/\u003EThese
        finds come from a spectacular Anglo-Saxon grave at Sutton Hoo, Suffolk. Dating
        from the early AD 600s, the burial was arranged inside a wooden chamber built
        in the middle of a 27-metre-long ship, covered by a high earth mound. It is
        the richest grave yet discovered from early medieval Europe, and would have
        commemorated a leading figure - perhaps a king - of the Anglo-Saxon kingdom
        of East Anglia.\u003C\/p\u003E\r\n\u003Cp style=\u0022text-align: justify;\u0022\u003E\u003Cspan
        style=\u0022text-decoration: underline;\u0022\u003E\u003Cstrong\u003EThe Sutton
        Hoo helmet\u003C\/strong\u003E\u003C\/span\u003E\u003Cbr \/\u003EThis is one
        of just four complete helmets to survive from Anglo-Saxon England. It has
        been painstakingly reconstructed from the shattered condition in which it
        was found. The Sutton Hoo helmet\u0027s exceptional survival and haunting
        appearance have made it an icon of the early medieval period.\u003C\/p\u003E\r\n\u003Cp
        style=\u0022text-align: justify;\u0022\u003EThe helmet consists of an iron
        cap with a crest, neck guard, cheek-pieces and face-mask. It was originally
        covered with tinned copper alloy pannels, decorated with animal and warrior
        motifs (not viewable from this scan).\u003C\/p\u003E\r\n\u003Cp style=\u0022text-align:
        justify;\u0022\u003EViewed together, the helmet\u0027s mouth, nose and eyebrows
        form the image of a flying beast.\u003C\/p\u003E\r\n\u003Cp style=\u0022text-align:
        justify;\u0022\u003ESimilar helmets are known from eastern Sweden, implying
        shared cultural traditions and interactions with East Anglia. The scarcity
        of surviving Anglo-Saxon helmets indicates that only those of great status
        could possess them.\u003C\/p\u003E","printing_details":"little  support","printing_details_html":"little  support","featured":false,"support":true,"complexity":0,"complexity_name":null,"dimensions":"59\u00d744\u00d759","material_quantity":"13","images":[{"id":155068,"upload_id":null,"is_primary":true,"original":{"url":"https:\/\/dl.myminifactory.com\/object-assets\/584e9885d7d0b\/images\/1000x1000-87e3e0b7344f503fd30ba2f1cf3259a05e2f8213.jpg","width":null,"height":null},"tiny":{"url":"https:\/\/dl.myminifactory.com\/object-assets\/584e9885d7d0b\/images\/70X70-1000x1000-87e3e0b7344f503fd30ba2f1cf3259a05e2f8213.jpg","width":70,"height":70},"thumbnail":{"url":"https:\/\/dl.myminifactory.com\/object-assets\/584e9885d7d0b\/images\/230X230-1000x1000-87e3e0b7344f503fd30ba2f1cf3259a05e2f8213.jpg","width":230,"height":230},"standard":{"url":"https:\/\/dl.myminifactory.com\/object-assets\/584e9885d7d0b\/images\/720X720-1000x1000-87e3e0b7344f503fd30ba2f1cf3259a05e2f8213.jpg","width":720,"height":720},"large":{"url":"https:\/\/dl.myminifactory.com\/object-assets\/584e9885d7d0b\/images\/1000X1000-1000x1000-87e3e0b7344f503fd30ba2f1cf3259a05e2f8213.jpg","width":1000,"height":1000},"is_print_image_selected":null},{"id":154422,"upload_id":null,"is_primary":false,"original":{"url":"https:\/\/dl.myminifactory.com\/object-assets\/584e9885d7d0b\/images\/screen-shot-2015-10-05-at-18-28-48.jpg","width":0,"height":0},"tiny":{"url":"https:\/\/dl.myminifactory.com\/object-assets\/584e9885d7d0b\/images\/70X70-screen-shot-2015-10-05-at-18-28-48.jpg","width":70,"height":70},"thumbnail":{"url":"https:\/\/dl.myminifactory.com\/object-assets\/584e9885d7d0b\/images\/230X230-screen-shot-2015-10-05-at-18-28-48.jpg","width":230,"height":230},"standard":{"url":"https:\/\/dl.myminifactory.com\/object-assets\/584e9885d7d0b\/images\/720X720-screen-shot-2015-10-05-at-18-28-48.jpg","width":720,"height":720},"large":{"url":"https:\/\/dl.myminifactory.com\/object-assets\/584e9885d7d0b\/images\/1000X10